import React, {useEffect} from "react";
import {BehaviorSubject} from "rxjs";
import {Movie} from "../../interfaces";

interface CardProps {
    item:Movie
}

const Card = (props:CardProps) => {
    const subject$ = new BehaviorSubject(props.item);
    const {item} = props
    console.log(subject$)
    useEffect(() => {
        subject$.subscribe()
        return subject$.subscribe().unsubscribe()
    },[])

    return <div style={{padding: 10}}>
        <div style={{display: "flex", justifyContent: "space-between"}}>
            <div>Rate: {item.rate}</div>
            <div>Title: {item.title}</div>
        </div>
        <img width={200} height={300} src={item.image} alt={item.title}/>
    </div>;
};

export default Card;
